css:
.auto-cursor {
  cursor: default;
}
kite-links.one-line {
  margin-top: 10px;
  margin-left: -0.9em;
  line-height: 1.0;
  display: flex;
  align-items: center;
  align-content: center;
}
kite-links.one-line .flex-separator {
  flex-grow: 1;
}
kite-links a,
kite-links a:hover,
kite-links a:focus,
kite-links a:active {
  color: #6494ed;
  font-size: 1.0rem;
  flex: 0;
  text-decoration: none !important;
  display: inline-block;
  padding: 1em 0.3em;
  margin: -1em 0;
}
kite-links a .kite-link-icon,
kite-links a:hover .kite-link-icon,
kite-links a:focus .kite-link-icon,
kite-links a:active .kite-link-icon {
  color: #9da5b4 !important;
  padding-left: 2px;
}
kite-links a:hover {
  color: #d7dae0 !important;
  text-decoration: underline;
}
kite-links a:first-of-type {
  padding-left: 1em;
}
kite-links a:last-of-type {
  padding-right: 1em;
}
